    <h2>PRINCIPAIS COMANDOS</h2>

    <p>O comando "title" serve para criar um título.</p>
    <p>O comando "img" serve para linkar imagens no site.</p>
    <p>O comando "a" linkar uma imagem ou escrita, dependendo do caso.</p>
